import React from 'react'

const PresentNews = (props) => {

    const { news } = props

    return (
        <div className="news-container wrapper">
            {news.map((n, index) =>
                <div key={index} className="eachnews">
                    <img src={n.img}></img>
                    <h5>{n.author}</h5>
                </div>
            )}
        </div>
    )
}

export default PresentNews;
